'10': ['111312', '231100', '312110', '336011', '321131', '003171', '312010'],
'11': ['223101', '202212', '113111', '140111', '121221', '172132', '330114'],
'12': ['321190', '113112', '611233', '111131', '301110', '131301', '273111'],
'13': ['212121', '011522', '712013', '785252', '132211', '002121', '111210'],
'14': ['212321', '031122', '167031', '933010', '323122', '103011', '110220'],
